# Async support# RustFuturePoll values
_UNIFFI_RUST_FUTURE_POLL_READY = 0
_UNIFFI_RUST_FUTURE_POLL_MAYBE_READY = 1

# Stores futures for _uniffi_continuation_callback
_UniffiContinuationPointerManager = _UniffiPointerManager()

# Continuation callback for async functions
# lift the return value or error and resolve the future, causing the async function to resume.
@_UNIFFI_FUTURE_CONTINUATION_T
def _uniffi_continuation_callback(future_ptr, poll_code):
    (eventloop, future) = _UniffiContinuationPointerManager.release_pointer(future_ptr)
    eventloop.call_soon_threadsafe(_uniffi_set_future_result, future, poll_code)

def _uniffi_set_future_result(future, poll_code):
    if not future.cancelled():
        future.set_result(poll_code)

async def _uniffi_rust_call_async(rust_future, ffi_poll, ffi_complete, ffi_free, lift_func, error_ffi_converter):
    try:
        eventloop = asyncio.get_running_loop()

        # Loop and poll until we see a _UNIFFI_RUST_FUTURE_POLL_READY value
        while True:
            future = eventloop.create_future()
            ffi_poll(
                rust_future,
                _uniffi_continuation_callback,
                _UniffiContinuationPointerManager.new_pointer((eventloop, future)),
            )
            poll_code = await future
            if poll_code == _UNIFFI_RUST_FUTURE_POLL_READY:
                break

        return lift_func(
            _rust_call_with_error(error_ffi_converter, ffi_complete, rust_future)
        )
    finally:
        ffi_free(rust_future)

# Public interface members begin here.


class _UniffiConverterString:
    @staticmethod
    def check_lower(value):
        if not isinstance(value, str):
            raise TypeError("argument must be str, not {}".format(type(value).__name__))
        return value

    @staticmethod
    def read(buf):
        size = buf.read_i32()
        if size < 0:
            raise InternalError("Unexpected negative string length")
        utf8_bytes = buf.read(size)
        return utf8_bytes.decode("utf-8")

    @staticmethod
    def write(value, buf):
        utf8_bytes = value.encode("utf-8")
        buf.write_i32(len(utf8_bytes))
        buf.write(utf8_bytes)

    @staticmethod
    def lift(buf):
        with buf.consume_with_stream() as stream:
            return stream.read(stream.remaining()).decode("utf-8")

    @staticmethod
    def lower(value):
        with _UniffiRustBuffer.alloc_with_builder() as builder:
            builder.write(value.encode("utf-8"))
            return builder.finalize()


# Error
# We want to define each variant as a nested class that's also a subclass,
# which is tricky in Python.  To accomplish this we're going to create each
# class separately, then manually add the child classes to the base class's
# __dict__.  All of this happens in dummy class to avoid polluting the module
# namespace.
class Error(Exception):
    """
    Error type sent over the FFI by UniFFI.

    `uniffi::Error` only supports errors that are enums, so we need to have a single-variant enum here.
    """

    pass

_UniffiTempError = Error

class Error:  # type: ignore
    class Error(_UniffiTempError):
        """
        Any error ocurring in the SDK
        """


        def __init__(self, msg):
            super().__init__(", ".join([
                "msg={!r}".format(msg),
            ]))
            self.msg = msg
        def __repr__(self):
            return "Error.Error({})".format(str(self))
    _UniffiTempError.Error = Error # type: ignore

Error = _UniffiTempError # type: ignore
del _UniffiTempError


class _UniffiConverterTypeError(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return Error.Error(
                msg=_UniffiConverterString.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    @staticmethod
    def check_lower(value):
        if isinstance(value, Error.Error):
            _UniffiConverterString.check_lower(value.msg)
            return

    @staticmethod
    def write(value, buf):
        if isinstance(value, Error.Error):
            buf.write_i32(1)
            _UniffiConverterString.write(value.msg, buf)

def init_client(client_config: "str"):
    _UniffiConverterString.check_lower(client_config)
    
    return _uniffi_rust_call_async(
        _UniffiLib.uniffi_op_uniffi_core_fn_func_init_client(
        _UniffiConverterString.lower(client_config)),
        _UniffiLib.ffi_op_uniffi_core_rust_future_poll_rust_buffer,
        _UniffiLib.ffi_op_uniffi_core_rust_future_complete_rust_buffer,
        _UniffiLib.ffi_op_uniffi_core_rust_future_free_rust_buffer,
        # lift function
        _UniffiConverterString.lift,
        # Error FFI converter
        _UniffiConverterTypeError,
    )

def invoke(invocation: "str"):
    _UniffiConverterString.check_lower(invocation)
    
    return _uniffi_rust_call_async(
        _UniffiLib.uniffi_op_uniffi_core_fn_func_invoke(
        _UniffiConverterString.lower(invocation)),
        _UniffiLib.ffi_op_uniffi_core_rust_future_poll_rust_buffer,
        _UniffiLib.ffi_op_uniffi_core_rust_future_complete_rust_buffer,
        _UniffiLib.ffi_op_uniffi_core_rust_future_free_rust_buffer,
        # lift function
        _UniffiConverterString.lift,
        # Error FFI converter
        _UniffiConverterTypeError,
    )

def release_client(client_id: "str"):
    _UniffiConverterString.check_lower(client_id)
    
    _rust_call_with_error(_UniffiConverterTypeError,_UniffiLib.uniffi_op_uniffi_core_fn_func_release_client,
        _UniffiConverterString.lower(client_id))


